    false,nt"url": null,nt"notes": "The USFWS proposes to transfer the Indian
    Lakes portion of the Stillwater Wildlife Management Area to Churchill County, Nevada
    for the purposes of fish, wildlife, and outdoor recreation. Based on ongoing communications
    between Churchill County and the City of Fallon, Churchill County intends to subsequently
    convey the Indian Lakes area to the City of Fallon for the same purposes. As part
    of the Proposed Action, the 1948 Tripartite Agreement between the Service, Nevada
    Division of Wildlife, and the Truckee-Carson Irrigation District would be terminated
    as it applies to the Indian Lakes area.  Under the Proposed Action, easements would
    be reserved by the United States for existing irrigation canals and ditches, a possible
    future Indian Lakes bypass canal, existing recreational activities including camping,
    picnicking, swimming, fishing, hunting, and similar activities, and for the protection
    and study of cultural resources. Existing roadways would be dedicated for continued
    public access. Before action is taken to transfer lands to Churchill County, the
    Department of the Interior would consult with the Nevada State  Historical Preservation
    Office on cultural resource issues.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
